class DateAxis(AxisItem):
    def tickStrings(self, values, scale, spacing):
        strns = []
        string = '%H:%M:%S'
        for x in values:
            try:
                strns.append(time.strftime(string, time.localtime(x)))
            except ValueError:  ## Windows can't handle dates before 1970
                strns.append('')
        return strns

